  hits &lt;- map(dbs, \(x) tbl(x, "hits"))

  unlink("Data/Datasets/hits/*", recursive = TRUE)
  iwalk(hits, \(x, i) {
    message(i) 
    r &lt;- select(runs[[i]], "runID", "speciesID", "tagDeployID", "tagID", 
