Assumptions
In this script we’ll be filtering out unlikely movements between stations (i.e. super fast birds).
This involves setting a maximum allowable flight speed, but also the distance from a station in which a bird could conceivably be detected (otherwise we might calculate super fast flight speeds simply because a bird was at the detection limit of two stations and moved back and forth across the boundary).
We will assume the following limits for max_flight_speed and max_tower_dist (defined in XX_setup.R).

Flight speed 72 m/s (max_flight_speed)

from Amie via Anderson et al. (2019) and Gronroos et al. (2012))
for shorebirds and with a buffer to avoid missing true flights, so may be much faster than realistic for our birds (false positives)

Tower distance 50 km (max_tower_dist)

from Amie, based on a 25km radius at each tower (so 50 between the two)
generous as most towers have a smaller detection range, but possible

Get distances among stations
We’ll be looking at movements between stations and how quickly they occur. So the first step is to calculate these distances and then our minimum time to travel between those two towers.

Here we use the units package to handle the unit conversions for time (min) and distance (m) into speed (km/day)
Units can then be compared with the max_flight_speed in units of m/s

We can’t reliably assess speed over very small distances, because each tower could presumably detect birds up to 25km away.
So we’ll only consider fast birds when the distance between towers is greater than our buffer max_tower_dist and the flight speed is more than max_flight_speed

recvs &lt;- runs |&gt;
  select(contains("recv")) |&gt;
  distinct() |&gt;
  drop_na()

recvs_sf &lt;- recvs |&gt;
  st_as_sf(coords = c("recvDeployLon", "recvDeployLat"), crs = 4326) |&gt;
  arrange(recvDeployID)

dist &lt;- st_distance(recvs_sf) |&gt;
  as_tibble() |&gt;
  mutate(recv_from = recvs_sf$recvDeployID) |&gt;
  relocate(recv_from) |&gt;
  rename_with(\(x) as.character(recvs_sf$recvDeployID), .cols = -1) |&gt;
  pivot_longer(-recv_from, names_to = "recv_to", values_to = "next_dist") |&gt;
  mutate(recv_to = as.integer(recv_to)) |&gt;
  arrange(recv_from, recv_to) |&gt;
  mutate(next_pair = paste0(recv_from, "_", recv_to),
         next_dist = set_units(next_dist, "km"),
         min_time = next_dist / max_flight_speed) |&gt;
  #filter(next_dist &gt; max_tower_dist) |&gt;
  mutate(min_time = as.duration(as.numeric(set_units(min_time, "s"))))

write_rds(dist, "Data/Datasets/stn_dist.rds")

Summarize Bouts
Now we’ll summarize the runs into detection bouts for each receiver for each individual.
For example, if a bird was detected around a station for a total of 6 hours over the course of 10 runs, we would collapse this down into one detection bout of 6 hours.
We’ll use a bout_cutoff of 30 defined in XX_setup.R. So if two runs at the same station are more than 30 apart, we’ll consider those runs to belong to separate bouts.
Because there are overlapping runs we need to run the bout collapsing function several times, first sorting by the run start time timeBegin, next by the run end time timeEnd. Then we try collapsing the bouts again, if we end up with fewer rows of data (i.e. more runs were collapsed), we continue.
We stop once we cannot collapse any more runs together.
This step using the furrr package to run the iterations in parallel over each tagDeployID and recvDeployID

plan(multisession, workers = 6) # Setup parallel

bouts &lt;- nest(groups, .by = c("tagDeployID", "stn_group")) |&gt;
  mutate(data = future_map(data, \(x) {
    x1 &lt;- create_bouts(arrange(x, timeBegin), bout_cutoff)
    x2 &lt;- create_bouts(arrange(x1, timeEnd), bout_cutoff)

    # Keep running until no more overlaps to resolved    
    while(nrow(x1) != nrow(x2)) {
      x1 &lt;- create_bouts(arrange(x2, timeBegin), bout_cutoff)
      x2 &lt;- create_bouts(arrange(x1, timeEnd), bout_cutoff)
    }

    x2 |&gt;
      mutate(n_runs = map_dbl(runID, n_distinct),
             len_min = map_dbl(len, min),
             len_max = map_dbl(len, max),
             n_ant = map_dbl(ant, n_distinct))
  }, .progress = interactive(), .options = furrr_options(seed = 123))) |&gt;
  unnest(data) |&gt;
  mutate(dateBegin = as_date(timeBegin),
         # Use first station in a group to define recvDeployID
         recvDeployID = as.numeric(str_split_i(stn_group, "-", i = 1)), 
         id = paste0(tagDeployID, "_", stn_group, "_", bout)) |&gt;
  arrange(tagDeployID, timeBegin) |&gt;
  left_join(recvs, by = "recvDeployID")

