    bb[1:2] &lt;- bb[1:2] + (c(-1, 1) * add)
  }
  if(ry &lt; 2) {
    add &lt;- (2 - ry)/2
    bb[3:4] &lt;- bb[3:4] + (c(-1, 1) * add)
  }

  ry &lt;- diff(range(bb[3:4]))
  rx &lt;- diff(range(bb[1:2]))
  ratio &lt;- ry/rx

  if(ratio &gt; 2) {
    rx1 &lt;- ry/2
