        .by = trans_id) |&gt;
      select(-trans_id) |&gt;
      distinct()
  } else labs &lt;- data.frame()

  g &lt;- ggplot(trans, aes(x = lon1, y = lat1)) +
    annotation_map_tile(type = "cartolight", zoomin = 0) +
    geom_spatial_segment(
      data = filter(trans, resolved, problem),
